import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';
import PokerRoom from './PokerRoom';

function App() {
    return (
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/room/:roomName" element={<PokerRoom />} />
        </Routes>
    );
}

export default App;
